address: :22
apiVersion: v1
commands:
- handler: Documents Images  Desktop Downloads .m2 .kube .ssh  .docker
  plugin: null
  regex: ^ls$
- handler: /home/
  plugin: null
  regex: ^pwd$
- handler: x86_64
  plugin: null
  regex: ^uname -m$
- handler: CONTAINER ID   IMAGE     COMMAND   CREATED   STATUS    PORTS     NAMES
  plugin: null
  regex: ^docker ps$
- handler: 'Error response from daemon: dial unix docker.raw.sock: connect: connection
    refused'
  plugin: null
  regex: ^docker .*$
- handler: Linux
  plugin: null
  regex: ^uname$
- handler: '  PID TTY           TIME CMD

    21642 ttys000    0:00.07 /bin/dockerd'
  plugin: null
  regex: ^ps$
- handler: command not found
  plugin: null
  regex: ^(.+)$
cve_description: ''
cve_tags: []
deadlineTimeoutSeconds: 60
description: SSH interactive
passwordRegex: ^(root|qwerty|Smoker666|123456|jenkins|minecraft|sinus|alex|postgres|Ly123456)$
plugin: null
protocol: ssh
serverName: ubuntu
